import { FormGroup, FormLabel, FormControl, FormText } from "react-bootstrap";


class Login extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            username: ''
        }
    }

    handleChance = (event) => {
        this.setState({
            usename: event
        })
    }

    render() {
        return (
        <div>
            <h1>Login Here</h1>
            <FormGroup controlId="loginForm">
                <FormLabel>Email Address</FormLabel>
                <FormControl type="email" placeholder="Enter Email"/>s
                <FormText type="text" placeholder='Username' value={this.state.username}></FormText>
            </FormGroup>
        </div>
        )
    }

}

export default Login;
